.jquery-loading-modal{
  transform:translateZ(0);
  display:flex;
  position:fixed;
  width:100%;
  height:100%;
  z-index:9999;
  justify-content:center;
  align-items:center;
  top:0;
  left:0
}

.jquery-loading-modal__animation{
  display:inline-block
}

.jquery-loading-modal__animation *{
  transition:background-color 1s ease-in
}

.jquery-loading-modal__animation *:before{
  transition:background-color 1s ease-in
}

.jquery-loading-modal__bg{
  position:absolute;
  z-index:1;
  width:100%;
  height:100%;
  opacity:.7;
  background-color:#000;
  transition:background-color 1s ease-in
}

.jquery-loading-modal__info-box{
  position:relative;
  text-align:center;
  z-index:2
}

.jquery-loading-modal__text{
  font-family:'Open Sans',sans-serif;
  font-size:18px;
  text-align:center;
  transition:color 1s ease-in
}

.jquery-loading-modal--visible{
  animation-duration:1s;
  animation-fill-mode:both;
  animation-name:fadeIn
}

.jquery-loading-modal--hidden{
  animation-duration:1s;
  animation-fill-mode:both;
  animation-name:fadeOut
}

@keyframes fadeOut{
  from{
    opacity:1
  }

  to{
    opacity:0
  }
}

@keyframes fadeIn{
  from{
    opacity:0
  }

  to{
    opacity:1
  }
}
